import React, { Component } from 'react';
import logo from './logo.svg';
import './App.scss';

class App extends Component {
  render() {
    return (
      <div className="App">
            <NavBar/>
            <VideoSection/>

      </div>
    );
  }
}

class NavBar extends React.Component {
  render() {
    // let imgURl="http://localhost:3000/Assets/Icons/BrainFlix\Logo.svg"

    return (
      <header class="header">
            <div class="header__logo">
              <h1>Brainfix</h1>
              <img className="logo-photo" ></img> 
            </div>
            <div class="header__links header__links--right">
              <input class="search" placeholder="Search..." />
              <img className="search-button" ></img>
            </div>
            <img className="upload-video" ></img>
            <img className="user-icon" ></img>
      </header>
    );
  }
}



class VideoSection extends  React.Component {
  render() {

    return (
      <section className="video__section">
        <video></video>
        <p>Jose Bautista hammers go-ahead three-run shot in ALDS Game 5, delivers epic bat flip</p>
        <p>2,304,189 views</p>
        <div className="video__section--comments">
        <img src="" className="like-logo" alt="6000" />
        <img src="" className="dislike-logo" alt="200" />
        <img src="" className="share-logo" alt="Share" />
        </div>
      </section>
    );
  }
}






export default App;
